import{_ as e,o as a,c as i,O as o}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 13.1-829 Corporate name.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/13.1-829.md","filePath":"vacode/13.1-829.md"}'),t={name:"vacode/13.1-829.md"},r=o('<h1 id="§-13-1-829-corporate-name" tabindex="-1">§ 13.1-829 Corporate name. <a class="header-anchor" href="#§-13-1-829-corporate-name" aria-label="Permalink to &quot;§ 13.1-829 Corporate name.&quot;">​</a></h1><p>A. A corporate name shall not contain:</p><ol><li><p>Any word or phrase that indicates or implies that it is organized for the purpose of conducting any business other than a business that it is authorized to conduct;</p></li><li><p>The word &quot;redevelopment&quot; unless the corporation is organized as an urban redevelopment corporation pursuant to Chapter 190 of the Acts of Assembly of 1946, as amended;</p></li><li><p>Any word, abbreviation, or combination of characters that states or implies the corporation is a limited liability company, a limited partnership, a registered limited liability partnership, or a protected series of a series limited liability company; or</p></li><li><p>Any word or phrase that is prohibited by law for such corporation.</p></li></ol><p>B. Except as authorized by subsection C, a corporate name shall be distinguishable upon the records of the Commission from:</p><ol><li><p>The name of any corporation, whether issuing shares or not issuing shares, existing under the laws of the Commonwealth or authorized to transact business in the Commonwealth;</p></li><li><p>A corporate name reserved or registered under § <a href="/vacode/13.1-631/">13.1-631</a>, <a href="/vacode/13.1-632/">13.1-632</a>, <a href="/vacode/13.1-830/">13.1-830</a> or <a href="/vacode/13.1-831/">13.1-831</a>;</p></li><li><p>The designated name adopted by a foreign corporation, whether issuing shares or not issuing shares, because its real name is unavailable for use in the Commonwealth;</p></li><li><p>The name of a domestic limited liability company or a foreign limited liability company registered to transact business in the Commonwealth;</p></li><li><p>A limited liability company name reserved under § <a href="/vacode/13.1-1013/">13.1-1013</a>;</p></li><li><p>The designated name adopted by a foreign limited liability company because its real name is unavailable for use in the Commonwealth;</p></li><li><p>The name of a domestic business trust or a foreign business trust registered to transact business in the Commonwealth;</p></li><li><p>A business trust name reserved under § <a href="/vacode/13.1-1215/">13.1-1215</a>;</p></li><li><p>The designated name adopted by a foreign business trust because its real name is unavailable for use in the Commonwealth;</p></li><li><p>The name of a domestic limited partnership or a foreign limited partnership registered to transact business in the Commonwealth;</p></li><li><p>A limited partnership name reserved under § <a href="/vacode/50-73.3/">50-73.3</a>; and</p></li><li><p>The designated name adopted by a foreign limited partnership because its real name is unavailable for use in the Commonwealth.</p></li></ol><p>C. A domestic corporation may apply to the Commission for authorization to use a name that is not distinguishable upon the Commission&#39;s records from one or more of the names described in subsection B. The Commission shall authorize use of the name applied for if the other entity consents to the use in writing and submits an undertaking in form satisfactory to the Commission to change its name to a name that is distinguishable upon the records of the Commission from the name of the applying corporation.</p><p>D. The use of assumed names or fictitious names, as provided for in Chapter 5 (§ <a href="/vacode/59.1-69/">59.1-69</a> et seq.) of Title 59.1, is not affected by this chapter.</p><p>E. The Commission, in determining whether a corporate name is distinguishable upon its records from the name of any of the business entities listed in subsection B, shall not consider any word, phrase, abbreviation, or designation required or permitted under § <a href="/vacode/13.1-544.1/">13.1-544.1</a>, subsection A of § <a href="/vacode/13.1-630/">13.1-630</a>, subsection A of § <a href="/vacode/13.1-1012/">13.1-1012</a>, § <a href="/vacode/13.1-1104/">13.1-1104</a>, subsection A of § <a href="/vacode/50-73.2/">50-73.2</a>, and subdivision A 2 of § <a href="/vacode/50-73.78/">50-73.78</a> to be contained in the name of a business entity formed or organized under the laws of the Commonwealth or authorized or registered to transact business in the Commonwealth.</p><p>Code 1950, § 13.1-207; 1956, c. 428; 1975, c. 500; 1985, c. 522; 1986, c. 232; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0592" target="_blank" rel="noreferrer">592</a>; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0379" target="_blank" rel="noreferrer">379</a>; 2007, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0925" target="_blank" rel="noreferrer">925</a>; 2009, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0216" target="_blank" rel="noreferrer">216</a>; 2012, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0063" target="_blank" rel="noreferrer">63</a>; 2021, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0487" target="_blank" rel="noreferrer">487</a>.</p>',9),n=[r];function s(l,h,p,d,m,c){return a(),i("div",null,n)}const b=e(t,[["render",s]]);export{u as __pageData,b as default};
